    Raphael.fn.pieChart = function (cx, cy,  values, labels, stroke, miterlimit, opacity, width ,colors, colors_over) {
        var paper = this,
            chart = this.set();
        function sector(value, params) {
            return paper.path(value).attr(params);
        }
        var total = 0,
            start = 100,
            process = function (j) {
                var value = values[j],
                    color = Raphael.hsb(start, .75, 1),
                    ms = 500,
                    delta = 30,
                    bcolor = Raphael.hsb(start, 1, 1),
                    p = sector(value, {"stroke-opacity": opacity[j] ,fill: colors[j], stroke: stroke[j], "stroke-width": width[j], "stroke-miterlimit": miterlimit[j]}),
                    txt = paper.text(cx , cy , labels[j]).attr({fill: colors[j], stroke: "none", opacity: 0, "font-size": 20});
                p.mouseover(function () {
                    p.stop().animate({'fill': bcolor}, ms, "elastic");
                    txt.stop().animate({opacity: 1}, ms, "elastic");
                }).mouseout(function () {
                    p.stop().animate({'fill': colors[j]}, ms, "elastic");
                    txt.stop().animate({opacity: 0}, ms);
                });
                chart.push(p);
                chart.push(txt);
                start += .1;
            };
        for (var i = 0, ii = values.length; i < ii; i++) {
            total += values[i];
        }
        for (i = 0; i < ii; i++) {
            process(i);
        }
        return chart;
    };

